import React from "react";
//Import Local Components
import List from "./List/List";
import Start_Shooping from "./Start_Shooping/Start_Shooping";
const Regular_List = ({ items }) => {
	return (
		<div>
			<div>
				<Grid container className={styles.top_container}>
					<Grid item xs={3}>
						<Typography className={styles.userName}> Hi {user.name}</Typography>
					</Grid>

					<Grid item xs={9} className={styles.buttons}>
						<Button
							fontSize="small"
							startIcon={<ShareIcon />}
							className={styles.topIconButton1}
						>
							Share
						</Button>
						<Button
							fontSize="small"
							startIcon={<EditIcon />}
							className={styles.topIconButton2}
							onClick={() => set_isEditable(!isEditable)}
						>
							Edit
						</Button>
					</Grid>
				</Grid>
			</div>
			<div>
				{items.map((item) => (
					<List item={item} />
				))}
			</div>
			<div>
				<Start_Shooping />
			</div>
		</div>
	);
};

export default Regular_List;
